import React from 'react';
import eesa from '../images/eesa-icon.png';
import { makeStyles } from '@material-ui/styles';

const useStyles = makeStyles({
    eesa: {
        height:80,
        width:100,
        bottom:10
    },
    text:{
        fontSize:8,
        color:"#FFFFFF"
    }
  });

const Bottom = () =>{
    const classes = useStyles();
    return(
        <div>
            <img className={classes.eesa} src={eesa}/>
            <p className={classes.text}>聯絡信箱:ntueesa@gmail.com</p>
            <p className={classes.text}>台灣大學電機工程學系 系學會</p>
        </div>
    );
};


export default Bottom ;
